import PropTypes from 'prop-types'

const Header = ({title}) => {
    return (
        <header>
            <h1 style={headingStyle}>Welcome to {title}</h1>
        </header>
    )
}

Header.defaultProps = {
    title : 'Task Tracker',
}

Header.propTypes = {
    title : PropTypes.string.isRequired,
}

//You can also add CSS in JS
const headingStyle = {
    color: 'red', 
    backgroundColor: 'black',
    textAlign: 'center',
}

export default Header
